import './Header.css'
import { HashLink } from 'react-router-hash-link';

function Header() {
    return (
        <div className='header'>
            <ul>
                <li>Home</li>
                <li>RoadMap</li>
                <li>About</li>
            </ul>
        </div>
    )
}

export default Header
